import React from "react";
import './Header.css';

export const Header = (props) => {
    return (
            <div className='origin'>
                <h1 className='name-colour'>Header</h1>

                <div class="main-button-container">
                    <button class="main-button-background">Button 51</button>
                    <div class="main-button-foreground"></div>
                </div>

                <br/>
                <br/>
                <br/>

                <div class="top-button-container">
                    <button class="top-button-background">Button 51</button>
                    <div class="top-button-foreground"></div>
                </div>
            </div>
    )
}
